import React from "react";
import "./People.css";
import Header from "./Header";
import { TextInput, SearchIcon } from "evergreen-ui";

function People() {
    const searchbox = {
        border: "solid 1.5px #707070",
        borderRadius: "5px",
        paddingLeft: "30px",
    };
    return (
        <div>
            <Header />
            <div className="people">
                <TextInput
                    className="searchbox"
                    width={850}
                    height={45}
                    style={searchbox}
                    placeholder="Search for people and teams"
                />
                <SearchIcon className="searchicon" />
            </div>
        </div>
    );
}

export default People;
